con:configuration.scriptText:
//Get the TestStep in teh current running TestCase called Properties
def propertiesTestStep = context.getTestCase().getTestStepByName('Properties')

//Get all the properties starting with bookingId
def bookingIdPropertyNames = propertiesTestStep.getPropertyNames().findAll{ it.startsWith('bookingId')}
def expectedBookingIds = bookingIdPropertyNames.collect{propertiesTestStep.getPropertyValue(it)}
log.info("Expected bookingIds: $expectedBookingIds")

//Slurp the xml and set some appropriate namespaces so that we are good to go when it comes to traversing the xml tree
def xml = new XmlSlurper().parseText(messageExchange.responseContentAsXml).declareNamespace([ns4: 'urn:riv:interoperability:headers:1', ns2: 'urn:riv:crm:scheduling:1.1',
		urn: 'urn:riv:interoperability:headers:1', ns1: 'urn:riv:interoperability:headers:1', urn1: 'urn:riv:itintegration:registry:1', ns21: 'urn:riv:crm:scheduling:1',
		soapenv: 'http://schemas.xmlsoap.org/soap/envelope/', ns3: 'urn:riv:crm:scheduling:GetSubjectOfCareScheduleResponder:1'])


//Collect all values from the bookingId elements 
def actualBookingIds = xml.'soapenv:Body'.'ns3:GetSubjectOfCareScheduleResponse'.'ns3:timeslotDetail'.collect{it.'bookingId'}
log.info("Found these bookingIds: $actualBookingIds")

//Assert
expectedBookingIds.each{ expectedBookingId ->
	assert actualBookingIds.any{ actualBookingId -> actualBookingId == expectedBookingId}
}

